pragma solidity ^0.4.24;

import 'openzeppelin-solidity/contracts/ownership/Ownable.sol';
import 'openzeppelin-solidity/contracts/math/SafeMath.sol';
import '../AssetManager.sol';

contract AssetFactory is Ownable{
    using SafeMath for uint256;
    event AssetCreated(address Asset);

    function createAsset (
        address  _estimation,
        address  _manager,
        address  _property,
        address  _registrar,
        address  _terms,
        address  _trustee
    ) public onlyOwner returns(address){

        AssetManager newContract = new AssetManager(_estimation,
            _manager,
            _property,
            _registrar,
            _terms,
            _trustee);
        emit AssetCreated(address(newContract));
        return address(newContract);
    }

    function addEstimation(address _assetManagerAddress, address estimation) onlyOwner public {
        require(estimation != address(0));
        AssetManager  assetManager = AssetManager(_assetManagerAddress);
        assetManager.addEstimation(estimation);
    }

    function setAggregatorStones(address _assetManagerAddress, address aggregatedStonesAddress) onlyOwner public {
        require(aggregatedStonesAddress != address(0));
        AssetManager  assetManager = AssetManager(_assetManagerAddress);
        assetManager.setAggregatedStoneCoins(aggregatedStonesAddress);
    }

    function addManager(address _assetManagerAddress, address manager) onlyOwner public {
        require(manager != address(0));
        AssetManager  assetManager = AssetManager(_assetManagerAddress);
        assetManager.addManager(manager);
    }


    function removeManager(address _assetManagerAddress, address manager) onlyOwner public {
        require(manager != address(0));
        AssetManager  assetManager = AssetManager(_assetManagerAddress);
        assetManager.removeManager(manager);
    }

    function addProperty(address _assetManagerAddress, address property) onlyOwner public {
        require(property != address(0));
        AssetManager  assetManager = AssetManager(_assetManagerAddress);
        assetManager.addProperty(property);
    }

    function addRegistrar(address _assetManagerAddress, address registrar) onlyOwner public {
        require(registrar != address(0));
        AssetManager  assetManager = AssetManager(_assetManagerAddress);
        assetManager.addRegistrar(registrar);
    }

    function addTerms(address _assetManagerAddress, address _terms) onlyOwner public {
        require(_terms != address(0));
        AssetManager  assetManager = AssetManager(_assetManagerAddress);
        assetManager.addTerms(_terms);
    }

    function addTrustee(address _assetManagerAddress, address trustee) onlyOwner public {
        require(trustee != address(0));
        AssetManager  assetManager = AssetManager(_assetManagerAddress);
        assetManager.addTrustee(trustee);
    }

    function removeTrustee(address _assetManagerAddress, address trustee) onlyOwner public {
        require(trustee != address(0));
        AssetManager  assetManager = AssetManager(_assetManagerAddress);
        assetManager.removeTrustee(trustee);
    }

}
